import { Routes, Route } from "react-router-dom";
import "./App.css";
import LobbyScreen from "../src/Screens/LobbyScreen";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<LobbyScreen />} />
      </Routes>
    </div>
  );
}

export default App;
